def min_cost(cost, m, n):
    tc = [[0 for x in range(n)] for x in range(m)] 
    tc[0][0] = cost[0][0] 
    for i in range(1, m): 
        tc[i][0] = tc[i-1][0] + cost[i][0] 
    for j in range(1, n): 
        tc[0][j] = tc[0][j-1] + cost[0][j] 
    for i in range(1, m): 
        for j in range(1, n): 
            tc[i][j] = min(tc[i-1][j], tc[i][j-1]) + cost[i][j] 
    return tc[m-1][n-1]

