    freq = {}
    for i in range(n):
        if arr[i] in freq:
            freq[arr[i]] += 1
        else:
            freq[arr[i]] = 1

    # Sort the hash-table by value
    freq = dict(sorted(freq.items(), key = lambda i: i[1]))

    ans = 0

    # Increase the frequency of all elements
