def find_longest_repeating_subseq(str):
    n = len(str)

    # Create a DP matrix to store the lengths of the
    # longest repeating subsequences of all substrings
    dp = [[0 for i in range(n + 1)]
            for j in range(n + 1)]

    # Fill the DP matrix in bottom up manner
    for i in range(1, n + 1):
        for j in range(1, n + 1):
            if (str[i - 1] == str[j - 1] and i != j):
                dp[i][j] = 1 + dp[i - 1][j - 1]
            else:
                dp[i][j] = max(dp[i][j - 1], dp[i - 1][j])

    return dp[n][n]

