    if (low == high):
        return arr[low]
    # If there is only one element left
    if (high < low):
        return arr[0]
    # Find mid
    mid = low + (high - low) // 2;
    # If mid element is greater than next element then mid+1 element is the smallest
    if (arr[mid] > arr[mid + 1]):
        return arr[mid + 1]
    # If mid element is greater than previous element then mid element is the smallest
    if (arr[mid - 1] > arr[mid]):
