def count_partitions(nums):
    total = sum(nums)

    if total % 2 != 0:
        return 0

    target = total // 2
    dp = [[0] * (target + 1) for _ in range(len(nums) + 1)]

    for i in range(1, len(nums) + 1):
        for j in range(1, target + 1):
            if nums[i - 1] <= j:
                dp[i][j] = dp[i - 1][j - nums[i - 1]] + dp[i - 1][j]
            else:
                dp[i][j] = dp[i - 1][j]

    return dp[len(nums)][target]

