def count_no_of_ways(n, k):
    if n <= 0:
        return 0
    if n == 1:
        return k
    if n == 2:
        return k * k

    dp = [(0 for _ in range(n)) for _ in range(k)]

    for i in range(k):
        dp[i][0] = 1

    for i in range(1, n):
        dp[0][i] = (k - 1) * dp[0][i - 1]

        for j in range(1, k):
            dp[j][i] = (k - 1) * (dp[j][i - 1] + dp[j - 1][i - 1])

    return dp[k - 1][n - 1]

