def solve(arr, n, i, k, dp): 
    if i == n: 
        return 0
    if dp[i][k] != -1: 
        return dp[i][k] 
    op1 = solve(arr, n, i + 1, k, dp) 
    op2 = float('-inf') 
    if k != 0 and arr[i] > arr[k - 1]: 
        op2 = arr[i] + solve(arr, n, i + 1, i, dp) 
    dp[i][k] = max(op1, op2) 
    return dp[i][k]

