def min_flip_to_make_string_alternate(s):
  # Count the number of 0s and 1s in the string
  count0 = 0
  count1 = 0
  for i in range(len(s)):
    if s[i] == '0':
      count0 += 1
    else:
      count1 += 1

  # If the number of 0s and 1s is not equal, then it is not possible to make the string alternate
  if count0 != count1:
    return -1

  # Otherwise, the minimum number of flips required is the minimum of the number of 0s and 1s
  return min(count0, count1)

