def modular_sum(lst, n, m):
    # create an array to store the prefix sums
    prefix_sums = [0] * n

    # store the prefix sums
    for i in range(n):
        prefix_sums[i] = lst[i]

    for i in range(1, n):
        prefix_sums[i] += prefix_sums[i - 1]

    # create a hash table to store the remainders
    remainders = {}

    # iterate through the prefix sums
    for i in range(n):
        current_remainder = prefix_sums[i] % m

        # check if the remainder already exists in the hash table
        if current_remainder in remainders:
            return True

        # if not, add it to the hash table
        else:
            remainders[current_remainder] = True

    # if we reach the end of the prefix sums without finding a remainder that matches m, then there is no subset with a sum divisible by m
    return False

