    p = 2
    while (p * p<= N) :
        # If prime[p] is not changed,
        # then it is a prime
        if (prime[p] == True):

            # Update all multiples of p greater than or
            # equal to the square of it
            for i in range(p * p, N +1, p):
                prime[i] = False
        p += 1

