def super_seq(X, Y, m, n): 

    # base cases
    if m == 0: 
        return n 
    if n == 0: 
        return m 

    # if last characters are same, 
    # then no operation is required
    if X[m-1] == Y[n-1]: 
        return 1 + super_seq(X, Y, m-1, n-1) 

    # if the last character of X is 
    # not equal to last character of Y,
    # then we can remove the last  character
    # from X and try the other two cases. 
    return 1 + min(super_seq(X, Y, m-1, n), 
                   super_seq(X, Y, m, n-1))

